import React from "react";

function test() {
  const styles = {
    container: {
      backgroundColor: "#f0f0f0",
      padding: "20px",
      borderRadius: "8px",
      textAlign: "center",
    },
    heading: {
      color: "#333",
      fontSize: "24px",
    },
    button: {
      backgroundColor: "#007bff",
      color: "#fff",
      padding: "10px 20px",
      border: "none",
      borderRadius: "5px",
      cursor: "pointer",
    },
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Dummy Component</h1>
      <button style={styles.button}>Click Me</button>
    </div>
  );
}
export default test;
